import React from "react";

const Contacts = ({ contacts }) => {
  return (
    <div>
      <center>
        <h1>Contact List</h1>
      </center>
      {contacts.map((contact) => (
        <div>
          <div className="foundRepo">{contact.name}</div>
          <h2>Repositories</h2>
          <ul>
            {contact.repositories.map((item, index) => (
              <li key={index}>{item.name}</li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
};

export default Contacts;

